import styled from "styled-components";

const BgImg = styled.div`
  width: 100vw;
  height: 100vh;

  position: absolute;
  top: 0;
  left: 0;

  background-image: url(${props => props.bgImg});
`;

export const HomeStyles = {
  BgImg
};
